create table climatecodes(
  code varchar(4),
  name text,
  color varchar(7),
  primary key(code)
);


create table forecast(
  name varchar(24),
  fromtime datetime,
  totime datetime,
  periodno integer,
  periodname varchar(20),
  auxdata text,
  primary key(name,fromtime,totime)
);


create table info(
  name varchar(24),
  type varchar(32),
  country varchar(24),
  geolocation text,
  about text,
  province varchar(24),
  county varchar(24),
  municipality varchar(32),
  climatecode varchar(4),  
  climate text,
  charter varchar(24),
  postalcode varchar(32),
  areacode varchar(32),
  primary key(name)
);


create table user (
	  id integer,
    username varchar(128),
    email varchar(256),
    favlocation varchar(24),
    image varchar(256),
    primary key(id),
    foreign key (favlocation) REFERENCES info(name)
);


create table comment(
	  id integer,
    location varchar(24),
    replyto integer,
    author integer not null,
    content text,
    posted datetime,
    primary key(id),
    foreign key(location) references info(NAME),
    foreign key(replyto) references comment(ID),
    foreign key(author) references user(ID)
);


create table likes(
    user integer,
    comment integer,
    primary key (user,comment),
    foreign key(user) references user(id),
    foreign key(COMMENT) references comment(id)
);



