insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Arjeplog","Administration centre","Sweden",'{"ALTITUDE":"426","LATITUDE":"66.05173","LONGITUDE":"17.88606","GEOBASE":"geonames","GEOBASEID":"2725372"}',"Arjeplog is a locality and the seat of Arjeplog Municipality in Norrbotten County, province of Lapland, Sweden with 1,977 inhabitants in 2010.It is a popular winter test site for the Asian and European car industries and featured on an episode of the UK TV show Top Gear.Arjeplog has in the past offered families 100,000 kronor, or individuals 25,000 kronor to move to the town.","Dfc","Arjeplog has a subarctic climate typical of northern Sweden. Its winters are somewhat moderated by the mild maritime North Atlantic air to the west, although they are still very cold, long and snowy. Summers are short but can occasionally be warm and they also very bright due to Arjeplog's position close to the Arctic Circle. Daylight is sparse in winter, but during summer midnight sun is present for three weeks.[5] For an even longer period than that it does not get dark in Arjeplog. The presence of the midnight sun is in spite of Arjeplog being below the Arctic Circle, and is caused by the sun's trajectory not quite dropping below 0 in angle. As it is below the line Arjeplog does not experience complete lack of daylight during the winter solstice, but it is limited to less than three hours.Arjeplog is located on the lake of Hornavan, that freezes over every winter due to the cold temperatures, whereas the lake temperatures remain cool also in summer.","Lapland","Norrbotten County","Arjeplog Municipality","Unknown","","");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Barcelona","Regional capital","Spain",'{"ALTITUDE":"15","LATITUDE":"41.38879","LONGITUDE":"2.15899","GEOBASE":"geonames","GEOBASEID":"3128760"}',"Barcelona is a city on the coast of northeastern Spain. It is the capital and largest city of the autonomous community of Catalonia, as well as the second most populous municipality of Spain.With a population of 1.6 million within city limits, its urban area extends to numerous neighbouring municipalities within the Province of Barcelona and is home to around 4.8 million people, making it the fifth most populous urban area in the European Union after Paris, the Ruhr area, Madrid, and Milan","Csa","According to the Kppen climate classification, Barcelona has a maritime Mediterranean climate (Csa), with mild winters and warm to hot summers, while the rainiest seasons are autumn and spring.The rainfall pattern is characterised by a short (3 months) dry season in summer, as well as less winter rainfall than in a typical Mediterranean climate.This subtype, labelled as Portuguese by the French geographer George Viers after the climate classification of Emmanuel de Martonne and found in the NW Mediterranean area (e.g. Marseille), can be seen as transitional to the humid subtropical climate (Cfa) found in inland areas such as the Po Valley (e.g. Milan), whose rainfall is greater in summer, a feature of continental climates.","Catalonia","Barcelona","Barcelona","343","080xx","(+34) 93");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Grums","Administration centre","Sweden",'{"ALTITUDE":"55","LATITUDE":"59.3466","LONGITUDE":"13.10906","GEOBASE":"geonames","GEOBASEID":"2710343"}',"The dominating employer in Grums is the paper mill called Gruvns Bruk which is the largest private employer in Vrmland. There is also a lumber mill owned by Stora Enso.","Dfb","Consistently horrible weather combined with a thick frothy smell from the paper mill.","Vrmlands Ln","Vrmland","Grums Municipality","Unknown","664xx","(+46) 555");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Gvle","Regional capital","Sweden",'{"ALTITUDE":"3","LATITUDE":"60.67452","LONGITUDE":"17.14174","GEOBASE":"geonames","GEOBASEID":"2712414"}',"Gvle is a city in Sweden, the seat of Gvle Municipality and the capital of Gvleborg County. It had 102 418 inhabitants in 2019,[3] which makes it the 13th most populated city in Sweden.[1] It is the oldest city in the historical Norrland (Sweden's Northern Lands), having received its charter in1446 from Christopher of Bavaria. However, Gvle is far nearer the greater Stockholm region than it is to the other major settlements in Norrland.In recent years, the city has received a lot of international attention due to its large Yule Goat figure made of straw - the Gvle Goat. The goat is erected in December each year and is often subsequently vandalised, usually by someone setting it on fire. The goat has now become a symbol for the city and is being used for various marketing purposes.","Dfb","Gvle has a similar climate to the rest of central Sweden, with an average temperature of around 10 C (14 F) in January and 20 C (68 F) in July. Yearly rainfall is around 600 mm (23.62 in). Under the Kppen climate classification Gvle is classified as humid continental, in spite of thesignificant maritime influence. It is also one of the northernmost cities by significant size in the world with this climate type, since areas north of the 60th parallel for the most part are dominated by various subarctic climate types. Under the 1961-1990 normals, Gvle's fourth warmest month was just around the isotherm of 10 C (50 F) to not be classified as subarctic, but temperatures did go up sufficiently to be clear humid continental since.","Gstrikland","Gvleborg County","Gvle Municipality","Unknown","80x xx","(+46) 26");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Gothenburg","Regional capital","Sweden",'{"ALTITUDE":"10","LATITUDE":"57.70716","LONGITUDE":"11.96679","GEOBASE":"geonames","GEOBASEID":"2711537"}',"The city was named Gteborg in the city's charter in 1621[11] and simultaneously given the German and English name Gothenburg. The Swedish name was given after the Gta lv, called Gta River in English and other cities ending in -borg.Both the Swedish and German/English names were in use before 1621 and had already been used for the previous city founded in 1604 and burned down in 1611.[17] Gothenburg is one of few Swedish cities to still have an official and widely used exonym. Another example is the province of Scania in southern Sweden.","Dfb","Gothenburg has a warm-summer humid continental climate using the 0C isotherm (Kppen Dfb) and an oceanic climate using the -3 C isotherm (Kppen Cfb) according to the Kppen climate classification. Despite its northern latitude, temperatures are quite mild throughout the year and warmer than places in similar latitude, for example, Stockholm, or even somewhat further south, mainly because of the moderating influence of the warm Gulf Stream.[39] During the summer, daylight extends 18 hours and 5 minutes, but lasts 6 hours and 32 minutes in late December. The climate has become significantly milder in later decades, particularly in summer and winter; July temperatures used to be below Stockholm's 19611990 averages, but have since been warmer than that benchmark.Summers are warm and pleasant with average high temperatures of 19 to 20C (66 to 68 F) and lows of 10 to 12 C (50 to 54 F), but temperatures of 2530 C (7786 F) occur on many days during the summer. Winters are cold and windy with temperatures of around 3 to 3 C (27 to 37 F), though it rarely drops below 20 C (4 F). Precipitation is regular but generally moderate throughout the year. Snow mainly occurs from December to March, but is not unusual in November and April and can sometimes occur even in October and May, in extreme cases even in September.[45]","Vstergtland and Bohusln","Vstra Gtaland County","Gothenburg Municipality","1621","40xxx 41xxx  421xx  427xx","(+46) 31");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Halmstad","Regional capital","Sweden",'{"ALTITUDE":"11","LATITUDE":"56.67446","LONGITUDE":"12.85676","GEOBASE":"geonames","GEOBASEID":"2708365"}',"Halmstad, at the time part of the Kingdom of Denmark, received its first city charter in 1307, and the city celebrated its 700th anniversary in 2007. The oldest remains of that first town are to be found at Ovraby upstream on Nissan, just south of and quite close to the present day regiment buildings. The remains of the church can still be seen today between a defunct brick industry and a former landfill.In the 1320s the town moved to the present day town centre. At this time there were two monasteries in the town and during the 15th century the St. Nikolai church was built. Halland was the object of numerous battles, sieges and occupations by Swedish troops.","Dfb","Halmstad has the south Scandinavian variety of the relatively wet humid continental climate (Dfb) with warm summers and cold winters, closely bordering on an oceanic climate (Cfb).","Halland","Halland County","Halmstad Municipality","1307","30x xx","(+46) 35");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Havana","Capital","Cuba",'{"ALTITUDE":"41","LATITUDE":"23.13302","LONGITUDE":"-82.38304","GEOBASE":"geonames","GEOBASEID":"3553478"}',"Havana is the capital city, largest city, province, major port, and leading commercial center of Cuba. The city has a population of 2.1 million inhabitants, and it spans a total of making it the largest city by area, the most populous city, and the fourth largest metropolitan area in the Caribbean region.The city of Havana was founded by the Spanish in the 16th century and due to its strategic location it served as a springboard for the Spanish conquest of the Americas, becoming a stopping point for treasure-laden Spanish galleons returning to Spain","Aw","Havana, like much of Cuba, has a tropical climate that is tempered by the island's position in the belt of the trade winds and by the warm offshore currents.Under the Kppen climate classification, Havana has a tropical savanna climate that closely borders on a tropical monsoon climate. Average temperatures range from 22 C (72 F) in January and February to 28 C (82 F) in August. The temperature seldom drops below 10 C (50 F). The lowest temperature was 1 C (34 F) in Santiago de Las Vegas, Boyeros","La Habana","-","La Habana","1519","10xxx19xxx","(+53) 07");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Helsingborg","Administration centre","Sweden",'{"ALTITUDE":"13","LATITUDE":"56.04673","LONGITUDE":"12.69437","GEOBASE":"geonames","GEOBASEID":"2706767"}',"Helsingborg (spelled Hlsingborg between 1912 and 1970) is a town and the seat of Helsingborg Municipality, Scania, Sweden. It had 108,334 inhabitants in 2017.Helsingborg is the centre of the northern part of western Scania and Swedens closest point to Denmark: the Danish city Helsingr is clearly visible about 4 km (2 mi) to the west on the other side of the resund. The HH Ferry route across the sound has more than 70 car ferry departures from each harbour every day.","Cfb","Helsingborg has an oceanic climate typical of southern Sweden, although its winters are very mild for a location at such a high latitude. Although the temperature differences between seasons are significant, Helsingborg often lacks a meteorological winter with both January and February averaging just above the freezing point in terms of mean temperatures.","Scania","Skne County","Helsingborg Municipality","1085","25X XX","(+46) 42");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Hudiksvall","Administration centre","Sweden",'{"ALTITUDE":"2","LATITUDE":"61.72897","LONGITUDE":"17.10358","GEOBASE":"geonames","GEOBASEID":"2704613"}',"Hudiksvall is a city and the seat of Hudiksvall Municipality, in Hlsingland, Gvleborg County, Sweden with 15,015 inhabitants in 2010. Hudiksvall is also known as Glada Hudik (English: Happy Hudik), a term that originated in the 19th century as word spread of its friendly hospitality and its lively social life.The city is located along the E4, on the east coast of Sweden deep inside the bay Hudiksvallsfjrden, about 80 km south of Sundsvall and about 130 km north of Gvle.Hudiksvall is Sweden's 76th largest urban area and also the largest urban area in Hlsingland.","Dfb","Hudiksvall has a humid continental climate with a significant maritime influence. In the 1961-1990 reference period it was just above subarctic, but that border region has since moved somewhat further north.Considering how far north it is, the climate is comparatively mild, with warm summers and moderated winters with daytime highs often hovering around the freezing point.Hudiksvall has a relatively wet climate with an annual precipitation rate averaging 646 millimetres (25.4 in) sometimes resulting in heavy snowfall during winters.","Hlsingland","VGvleborg County","Hudiksvall Municipality","1582","824xx","(+46) 650");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Jokkmokk","Administration centre","Sweden",'{"ALTITUDE":"251","LATITUDE":"66.60665","LONGITUDE":"19.82324","GEOBASE":"geonames","GEOBASEID":"2702997"}',"Jokkmokk is a locality and the seat of Jokkmokk Municipality in Norrbotten County, province of Lapland, Sweden, with 2,786 inhabitants in 2010.The Smi name of the place due to the meandering river that runs through it. It is just north of the Arctic Circle. Talvatissjn is located at the southern part of Jokkmokk.Jokkmokk is an important locality for Smi people and the location of several institutions related to them, including an education centre, the jtte museum, and an office of the Smi Parliament of Sweden.","Dfc","Influenced by its inland and northerly position, Jokkmokk's variety of a subarctic climate is very cold even by Swedish standards. Summers are normally relatively mild in spite of the day-round light and the dark winters are long and cold.","Lapland","Norrbotten","Jokkmokk Municipality","1611","962xx","(+46) 971");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Jnkping","Regional capital","Sweden",'{"ALTITUDE":"100","LATITUDE":"57.78145","LONGITUDE":"14.15618","GEOBASE":"geonames","GEOBASEID":"2702979"}',"Jnkping is a city in southern Sweden with 93,797 inhabitants (2015). Jnkping is situated at the southern end of Sweden's second largest lake, Vttern, in the province of Smland.The city is the seat of Jnkping Municipality, which has a population of 141 081 and is Smland's most populous municipality.Jnkping is also the seat of Jnkping County which has a population of 363 599. Jnkping is the seat of a district court and a court of appeal as well as the Swedish National Courts Administration. It is the seat of the Swedish Board of Agriculture.","Dfb","Jnkping's climate was humid continental (Kppen Dfb) with long, cold winters and short, warm summers during the 19611990 period. However, the window between subarctic and oceanic is very small in this marine-influenced climate type, and in recent years the climate has more resembled very coldoceanic.However, figures are slightly skewed due to the weather station being located at the airport which is at an elevation of 228 metres (748 ft), whereas the city centre is at 100 metres (330 ft). This likely renders up to between half a degree to a full degree milder temperatures in the urban centre.","Smland","Jnkping County","Jnkping Municipality","1284","55xxx - 561xx - 562xx","(+46) 36");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Kalmar","Regional capital","Sweden",'{"ALTITUDE":"7","LATITUDE":"56.66157","LONGITUDE":"16.36163","GEOBASE":"geonames","GEOBASEID":"2702261"}',"Kalmar is a city in the southeast of Sweden, situated by the Baltic Sea. It had 36,392 inhabitants in 2010 and is the seat of Kalmar Municipality. It is also the capital of Kalmar County, which comprises 12 municipalities with a total of 236,399 inhabitants (2015).From the thirteenth to the seventeenth centuries, Kalmar was one of Sweden's most important cities. Between 1602 and 1913 it was the episcopal see of Kalmar Diocese, with a bishop, and the Kalmar Cathedral from 1702 is still a fine example of classicistic architecture.","Cwc","Kalmar has a cold oceanic climate. It is somewhat continental with warm summers and cold winters which normally averages just above the freezing point during days and goes somewhat below it at night.It has some of the hottest temperatures recorded by Swedish cities for most months, with an all-time record of 35.2C (95.4 F).[7] The average summer temperatures however are quite normal for southern Sweden.","Smland","Kalmar County","Kalmar Municipality","1100","39X XX","(+46) 480");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Karlskrona","Regional capital","Sweden",'{"ALTITUDE":"18","LATITUDE":"56.16156","LONGITUDE":"15.58661","GEOBASE":"geonames","GEOBASEID":"2701713"}',"Karlskrona is a locality and the seat of Karlskrona Municipality, Blekinge County, Sweden with 66,675 inhabitants in 2018.It is also the capital of Blekinge County. Karlskrona is known as Sweden's only baroque city and is host to Sweden's only remaining naval base and the headquarters of the Swedish Coast Guard.","Cfb","The climate is damp, warm and temperate. The rainfall in Karlskrona is significant, with precipitation even during the driest month.The climate is classified as Cfb by the Kppen-Geiger system. The average annual temperature is 7.8 C | 46.0 F in Karlskrona. About 556 mm | 21.9 inch of precipitation falls annually.","Blekinge","Blekinge County","Karlskrona Municipality","1680","371 XX","(+46) 455");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Karlstad","Regional capital","Sweden",'{"ALTITUDE":"58","LATITUDE":"59.3793","LONGITUDE":"13.50357","GEOBASE":"geonames","GEOBASEID":"2701680"}',"Karlstad is a city, the seat of Karlstad Municipality, the capital of Vrmland County, and the largest city in the province Vrmland in Sweden. The city had 61,492 inhabitants in 2015 with 90,882 inhabitants in the wider municipality in 2017, and is the 21st biggest municipality in Sweden. Karlstad has a university and a cathedral.Karlstad is built on the river delta where Sweden's longest river, Klarlven, runs into Sweden's largest lake, Vnern. It has the second largest lake port in the country after Vsters.Karlstad is often associated with sunshine and the symbol for Karlstad is a smiling sun. Karlstad is reputed to be one of the sunniest towns in Sweden and a local waitress, known as Sola i Karlstad (the Sun in Karlstad) for her sunny disposition, is also commemorated with a statue.","Dfb","Karlstad has a humid continental climate (Dfb) with influence from the surrounding waters of Vnern and the inflow from the Atlantic Ocean.It has large differences between seasons and is moderately influenced by both marine and land airflows. The highest recorded temperature since 1901 is 34.0C (93.2F) in July 1933 and the lowest is -36.0C (-32.8F) from February 1966.","Vrmland","Vrmland County","Karlstad Municipality","1584","65X XX","(+46) 54");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Kiruna","Administration centre","Sweden",'{"ALTITUDE":"579","LATITUDE":"67.85572","LONGITUDE":"20.22513","GEOBASE":"geonames","GEOBASEID":"605155"}',"Kiruna is the northernmost town in Sweden, situated in the province of Lapland. It had 17,002 inhabitants in 2016 and is the seat of Kiruna Municipality (population: 23,167 in 2016) in Norrbotten County.Esrange Space Center was established in Kiruna in the 1960s.Also in Kiruna are the Institute of Space Physics and Lule University of Technology's Department of Space Science.","Dfc","Being located 145 km (90 miles) north of the Arctic Circle, Kiruna has a subarctic (Dfc) climate with short, cool summers and long, cold winters, although the city itself can be considerably milder than the surrounding forest. Snow cover generally lasts from late September to mid-May, but snowfall can occur year-round.The sun does not set between 28 May and 16 July (50 days), and white nights lasts from early May to early August. The period that the sun does not rise lasts from 11 December to 1 January (22 days), the exact boundaries depending on local topography.Even though Kiruna's winters are very cold by Swedish standards, they are still much less severe than winters on similar latitudes in North America and Siberia, and even more southerly areas in other parts of the world due to some maritime influence.Similar winter temperatures go as far south as below the 45th parallel in the Russian Far East. Kiruna however, has cooler summers than such areas, but still warm enough to stay above polar climate and below the northern tree line.Winter temperatures however are significantly colder than areas immediately affected by the Gulf Stream such, where in fact the regular lows of Kiruna during January and February are colder than or similar to Troms's all-time record low.","Lapland","Norrbotten County","Kiruna Municipality","1948","981xx","(+46) 980");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Kristianstad","Administration centre","Sweden",'{"ALTITUDE":"8","LATITUDE":"56.03129","LONGITUDE":"14.15242","GEOBASE":"geonames","GEOBASEID":"2699310"}',"Kristianstad older spelling Christianstad is a city and the seat of Kristianstad Municipality, Skne County, Sweden with 40,145 inhabitants in 2016.During the last 15 years, it has gone from a garrison town to a developed commercial city, today attracting visitors in the summertime mainly from Germany, Denmark and The Netherlands.","Cwa","Kristianstad has a humid continental climate but with the updated mean annual temperature can qualify for a humid subtropical climate which is very unusual for a city this far north.The city being lowest point in Sweden might explain the hot climate. Summers are warm and comparatively long by Swedish standards.","Scania","Skne County","Kristianstad Municipality","1614","291 XX","(+46) 44");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Lule","Regional capital","Sweden",'{"ALTITUDE":"17","LATITUDE":"65.58415","LONGITUDE":"22.15465","GEOBASE":"geonames","GEOBASEID":"604490"}',"Lule is a city on the coast of northern Sweden, and the capital of Norrbotten County, the northernmost county in Sweden. Lule has 48,728 inhabitants in its urban core (2018) and is the seat of Lule Municipality (with a total population of 76,770).Lule has the seventh biggest harbor in Sweden for shipping goods. It has a large steel industry and is a center for extensive research. Lule University of Technology is one of Sweden's three technology universities (the other two are KTH and Chalmers) and the northernmost university in Sweden.","Dfc","Lule has a subarctic climate (Kppen: Dfc), which borders on a continental climate (Kppen: Dfb) with short, mild to warm summers and long, cold, snowy winters.Due to the Gulf Stream, Lule has a warmer climate than other cities on the same latitude and even some that are further south in Canada, Alaska, Northeast China and Siberia. During the summer in June and July the temperature in Lule can some days rise to around +30 degrees Celsius.Summers are very bright, with marginal twillight being the only exception during the summer solstice.","Norrbotten","Norrbotten County","Lule Municipality","1621","97X XX","(+46) 920");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Malm","Regional capital","Sweden",'{"ALTITUDE":"10","LATITUDE":"55.60587","LONGITUDE":"13.00073","GEOBASE":"geonames","GEOBASEID":"2692969"}',"Malm is the largest city in the Swedish county (ln) of Skne (Scania). It is the third-largest city in Sweden, after Stockholm and Gothenburg, and the sixth-largest city in Scandinavia, with a population of 316,588 (municipal total 338,230 in 2018).The Malm Metropolitan Region is home to over 700,000 people, and the resund Region, which includes Malm, is home to 4 million people.Malm was one of the earliest and most industrialized towns in Scandinavia, but it struggled to adapt to post-industrialism.","Cfb","Malm, like the rest of southern Sweden, has an oceanic climate. Despite its northern location, the climate is mild compared to other locations at similar latitudes, mainly because of the influence of the Gulf Stream and also its westerly position on the Eurasian landmass. Owing to its northern latitude, daylight lasts 17 hours in midsummer, but only around seven hours in midwinter. According to data from 20022014 Falsterbo, to the south of the city, received an annual average of 1,895 hours of sunshine while Lund, to the north, received 1,803 hours. The sunshine data in the weather box is based on the data for Falsterbo.[14]Summers are mild with average high temperatures of 20 to 23C (68 to 73 F) and lows of around 11 to 13 C (52 to 55 F). Heat waves during the summer arise occasionally. Winters are fairly cold and windy, with temperatures steady between 3 to 4 C (27 to 39 F), but it rarely drops below 10 C (14 F).Rainfall is light to moderate throughout the year with 169 wet days. Snowfall occurs mainly in December through March, but snow covers do not remain for a long time,[15] and some winters are virtually free of snow.","Scania","Skne County","Malm Municipality","1275","2xxxx","(+46) 40");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Oslo","Capital","Norway",'{"ALTITUDE":"10","LATITUDE":"59.912726542422","LONGITUDE":"10.7460923576733","GEOBASE":"ssr","GEOBASEID":"72837"}',"Oslo is the capital and most populous city of Norway. It constitutes both a county and a municipality. During the Viking Age the area was part of Viken, the northernmost Danish province.Oslo was founded as a city at the end of the Viking Age in the year 1040 under the namenslo, and established as a kaupstad or trading place in 1048 by Harald Hardrada.","Dfb","Oslo has a humid continental climate (Kppen climate classification Dfb) with warm summers and cold winters. Due to oceanic influences, winters are less cold than more continental areas at same latitude. With 3 C (27 F) isotherm, it is also reasonable for Oslo to be classified as a borderline oceanic climate.Oslo has a significant amount of rainfall during the year. This is true even for the driest month. Because of the city's northern latitude, daylight varies greatly, from more than 18 hours in midsummer, when it never gets completely dark at night (no darker than nautical twilight), to around 6 hours in midwinter. Oslo sits right on the border between hardiness zones 7a and 7b.","stlandet","Oslo County","Oslo Municipality","1048","0001 1299","(+47) 2");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Stockholm","Capital","Sweden",'{"ALTITUDE":"28","LATITUDE":"59.33258","LONGITUDE":"18.0649","GEOBASE":"geonames","GEOBASEID":"2673730"}',"Stockholm is the capital and most populous urban area of Sweden as well as in Scandinavia. 972,647 people live in the municipality, approximately 1.6 million in the urban area, and 2.4 million in the metropolitan area.The city stretches across fourteen islands where Lake Mlaren flows into the Baltic Sea. Outside the city to the east, and along the coast, is the island chain of the Stockholm archipelago.The area has been settled since the Stone Age, in the 6th millennium BC, and was founded as a city in 1252 by Swedish statesman Birger Jarl. It is also the county seat of Stockholm County.Stockholm is the cultural, media, political, and economic centre of Sweden. The Stockholm region alone accounts for over a third of the country's GDP,[11] and is among the top 10 regions in Europe by GDP per capita","Cfb","Stockholm has an oceanic climate in the 0C isotherm (Kppen: Cfb)[38][39] and a humid continental climate (Dfb) in the -3 C isotherm. Although winters are cold, average temperatures generally remain above 0 C for much of the year.Summers are mild, and precipitation occurs throughout the year. Due to the city's high northerly latitude, the length of the day varies widely from more than 18 hours around midsummer to only around 6 hours in late December.The nights from late May until mid-July are bright even when cloudy. Stockholm has relatively mild weather compared to other locations at a similar latitude, or even farther south.With an average of just over 1800 hours of sunshine per year, it is also one of the sunniest cities in Northern Europe, receiving more sunshine than Paris, London and a few other major European cities of a more southerly latitude.","Sdermanland and Uppland","Stockholm County","Stockholm Municipality","1252","100 00--199 99","(+46) 8");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Sundsvall","Administration centre","Sweden",'{"ALTITUDE":"26","LATITUDE":"62.39129","LONGITUDE":"17.3063","GEOBASE":"geonames","GEOBASEID":"2670781"}',"Sundsvall is a city and the seat of Sundsvall Municipality in Vsternorrland County, Sweden. It has a population of 51,354 as of 2010; more than 95,000 live in the municipal area.The city has burned down and been rebuilt four times. The first time, in 1721, it was set on fire by the Russian army during the Russian Pillage of 1719-1721.","Dfc","Sundsvall has a climate which is on the border between subarctic and cold continental, leaning towards the latter in recent years. Temperatures are made significantly milder and regulated by the influence from the Gulf Stream.The weather station is located 20 kilometres (12 mi) to the north and somewhat further inland, which renders that Sundsvall's urban centre is likely milder in terms of low temperatures by some degree.","Medelpad","Vsternorrland County","Sundsvall Municipality","1621","85xxx","(+46) 60");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Uddevalla","Administration centre","Sweden",'{"ALTITUDE":"13","LATITUDE":"58.34784","LONGITUDE":"11.9424","GEOBASE":"geonames","GEOBASEID":"2666670"}',"Uddevalla is a town and the seat of Uddevalla Municipality in Vstra Gtaland County, Sweden. In 2010, it had a population of 31,212.It is located at a bay of the south-eastern part of Skagerrak. The beaches of Uddevalla are filled with seashells and Uddevalla has one of the largest shell-banks in the world.Uddevalla has a port and it once had a large shipyard, the Uddevallavarvet, which was the largest employer in Bohusln during the 1960s. The 1970s recession, that affected the Swedish shipyard industry severely, led to the closing of the wharf in 1985.","Cfb","Uddevalla lies on 21m above sea level The climate here is mild, and generally warm and temperate. Uddevalla is a city with a significant rainfall. Even in the driest month there is a lot of rain.The Kppen-Geiger climate classification is Cfb. The temperature here averages 7.0 C. The annual rainfall is 750 mm.","Bohusln","Vstra Gtaland County","Uddevalla Municipality","1498","451 XX","(+46) 522");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Ume","Regional capital","Sweden",'{"ALTITUDE":"24","LATITUDE":"63.82842","LONGITUDE":"20.25972","GEOBASE":"geonames","GEOBASEID":"602150"}',"Ume is a city in northeast Sweden. It is the seat of Ume Municipality and the capital of Vsterbotten County.Situated on the Ume River, Ume is the largest locality in Norrland and the thirteenth largest in Sweden, with 84,761 inhabitants in 2016.The municipality had 123,382 inhabitants as of 2017.When Ume University was established in 1965, growth accelerated, and the amount of housing has doubled in the last 30 years.Ume is a university town and centre of education, technical and medical research in northern Sweden, with two universities and over enrolled 39,000 students. Ume was the European Capital of Culture during 2014, along with Riga in Latvia.","Dfc","The climate of Ume is bordering on a humid continental and a subarctic climate, with short and fairly warm summers. Winters are lengthy and freezing but usually milder than in areas at the same latitude with a more continental climate.Average January temperature is about7 C (19 F), July is 16 C (61 F). Considering its proximity to a major water body and its latitude, summers are warmer than would be expected.The record high of 32.2C (90.0 F) was recorded on 23 July 2014, during a very warm summer in Sweden. The record low of 38.2 C (36.8 F) was recorded on 15 February 1978.","Vsterbotten","Vsterbotten County","Ume Municipality","1622","900 01 - 908 50","(+46) 90");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("Uppsala","Regional capital","Sweden",'{"ALTITUDE":"20","LATITUDE":"59.85882","LONGITUDE":"17.63889","GEOBASE":"geonames","GEOBASEID":"2666199"}',"Uppsala is the capital of Uppsala County and the fourth-largest city in Sweden, after Stockholm, Gothenburg, and Malm. It had 168,096 inhabitants in 2017.Located 71 km north of the capital Stockholm it is also the seat of Uppsala Municipality. Since 1164, Uppsala has been the ecclesiastical centre of Sweden, being the seat of the Archbishop of the Church of Sweden.Uppsala is home to Scandinavia's largest cathedral Uppsala Cathedral.[7] Founded in 1477, Uppsala University is the oldest centre of higher education in Scandinavia. Among many achievements, the Celsius scale for temperature was invented there.","Dfb","Uppsala lies immediately south of the 60th parallel north and has a humid continental climate, with cold winters and warm summers. Due to its northerly location, Uppsala experiences over 18 hours of visible sunshine during the summer solstice, and under 6 hours of sunshine during the winter solstice.Despite Uppsala's northerly location, the winter is not as cold as other cities at similar latitudes, mainly due to the Gulf Stream. For example, in January Uppsala has a daily mean of2.7 C. In Canada, at the same latitude, Fort Smith experiences a daily mean of 22.4 C.With respect to record temperatures, the difference between the highest and lowest is relatively large. Uppsalas highest recorded temperature was 37.4 C (99.3 F), recorded in July 1933. On the same day Ultuna, which lies a few kilometres south of the centre of Uppsala, recorded a temperature of 38 C.This is the highest temperature ever recorded in the Scandinavian Peninsula, although the same temperature was recorded in Mlilla, Sweden, 14 years later.","Uppland","Uppsalay","Uppsala Municipality","980","74X XX - 75X XX","(+46) 18");
insert into info(name,type,country,geolocation,about,climatecode,climate,province,municipality,country,charter,postalcode,areacode) values("rebro","Regional capital","Sweden",'{"ALTITUDE":"35","LATITUDE":"59.27412","LONGITUDE":"15.2066","GEOBASE":"geonames","GEOBASEID":"2686657"}',"rebro is a city with 124,027 inhabitants, the seat of rebro Municipality and the capital of rebro County in Sweden.It is the sixth largest city in Sweden and one of the largest inland hubs of the country. It is located near the lake of Hjlmaren, although a few kilometres inland along the small river Svartn.rebro is home to rebro University, a major university hospital, a medieval castle, the water park Gustavsvik as well as several large shopping malls and the Oset-Rynningeviken nature reserve at the lakefront.","Dfb","rebro, like the rest of the area close to Mlardalen, has a humid continental climate (Kppen Dfb) that is made milder by the proximity to water and the Gulf Stream which makes it interchangeable with oceanic climates.Summer temperatures occasionally exceed 30C (86 F) albeit not yearly, and temperatures above 5 C (41 F) are rare in winter, although frost-free nights sometimes occur.July high temperatures range from 20C (68 F) to 26 C (79 F) depending on weather patterns, with a 20022014 mean high of around 23.4 C (74.1 F). During cold winters, rebro receives plenty of snowfall.rebro is far more prone than coastal areas to really harsh frosts with temperatures approaching or below 20 C (4 F) happening almost every winter according to SMHI statistics.","Nrke","rebro County","rebro Municipality","1404","701 xx -- 702 xx -- 703 xx","(+46) 19");
